import React, { useEffect } from 'react';
import LogItem from '../logs/LogItem';
// import { getLogs } from '../../actions/logActions';

const Logs = () => {
  // useEffect(() => {
  //     getLogs
  // })
  return (
    <ul className='collection with-header'>
      <li className='collection-header center'>
        <h4>Logs</h4>
      </li>
      <LogItem />
    </ul>
  );
};

export default Logs;
